[code snippet 1 - Vulnerable]

```java
// Insecure use of the Java API, allowing arbitrary file uploads without proper validation
import java.io.File;
import java.io.FileInputStream;
import java.io.InputStream;

public class InsecureFileUpload {
    public static void main(String[] args) throws Exception {
        String fileName = args[0]; // User-supplied filename
        InputStream is = new FileInputStream(new File(fileName));
        // ...
    }
}
```

***

[code snippet 2 - Secure]

```java
// Secure use of the Java API, validating user-supplied filenames and using a whitelist
import java.io.File;
import java.io.FileInputStream;
import java.io.InputStream;
import java.util.Arrays;
import java.util.List;

public class SecureFileUpload {
    private static final List<String> ALLOWED_EXTENSIONS = Arrays.asList("jpg", "jpeg", "png");

    public static void main(String[] args) throws Exception {
        String fileName = args[0]; // User-supplied filename

        // Validate the file extension
        String extension = fileName.substring(fileName.lastIndexOf(".") + 1);
        if (!ALLOWED_EXTENSIONS.contains(extension)) {
            System.err.println("Invalid file extension. Allowed extensions are: " + ALLOWED_EXTENSIONS);
            return;
        }

        File file = new File(fileName);
        if (!file.exists()) {
            System.err.println("File not found.");
            return;
        }

        InputStream is = new FileInputStream(file);
        // ...
    }
}
```

In this example, the vulnerable code snippet allows arbitrary file uploads without any validation, which can lead to potential security vulnerabilities. The secure code snippet demonstrates a more secure approach by validating user-supplied filenames and only allowing certain file extensions.

